import { Component, OnInit } from '@angular/core';
import { RepuestoService } from '../../core/repuesto.service';
import { Router } from '@angular/router';

@Component({
  selector: 'app-navbar',
  templateUrl: './navbar.component.html',
  styleUrls: ['./navbar.component.css'],
})
export class NavbarComponent implements OnInit {
  id: any;

  constructor(private repuestoService: RepuestoService, private router: Router) {}

  ngOnInit() {}

  newRepuesto() {
    // Get max repuesto Id from the repuesto list
    this.repuestoService.getMaxRepuestoId().subscribe((data) => (this.id = data));
    this.router.navigate(['/repuestos', this.id, 'new']);
  }
}
<nav class="navbar navbar-expand-lg bg-light">
  <div class="container-fluid">
    <a class="navbar-brand" [routerLink]="['']">
        <img src="/assets/images/brujula.jpg" class="img-fluid">
    </a>
    <h3><a class="nav-link " [routerLink]="['']">Talleres MAFAH</a></h3>
    <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarScroll" aria-controls="navbarScroll" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse" id="navbarScroll">
      <ul class="navbar-nav me-auto my-6 my-lg-0 navbar-nav-scroll" style="--bs-scroll-height: 100px;">
        <li class="nav-item">
          <button style="margin: 10px" class="btn btn-dark" (click)="newRepuesto()">Agregar Repuesto</button>
        </li>
      </ul>
        <button style="margin: 10px" class="btn btn-dark" type="submit">Registrarse</button>
        <button style="margin: 10px" class="btn btn-dark" type="submit">Iniciar Sesion</button>
    </div>
  </div>
</nav>
